import React from "react";
import QA from "./QA";
import { BrowserRouter, Link, Route } from "react-router-dom";

export default class Btn extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    console.log(this.props.curCourse);
    return (
      <>
        <BrowserRouter>
          <Link to="/CourseQA">Courses QA</Link>
          <Route path="/CourseQA" component={QA}></Route>
        </BrowserRouter>
      </>
    );
  }
}
